function Search({ onFilterText }) {

    function handleSearch(event) {
        onFilterText(event.target.value);
    }
    return (
        <div className=""> 
            <input type="text" onChange={handleSearch} placeholder="Search..." />
        </div>
    );
}

export default Search;
